import './ModelX.css'
import modelxback from './teslaimg/Desktop-ModelX.jpeg'
import HeaderPage from "./HeaderPage"
const ModelX = () => {
    return ( 
        <div>
          <HeaderPage
         title="Model X"
         background={modelxback}
         description="Plaid"
         range="628
         km"
         time="1.99s"
         speed="322
         km/h"
         horsepower="1,020hp"
         first
      />
       </div>
     );
}
 
export default ModelX;
